import ReactDOM from 'react-dom'
import './index.css'
import App from './App'
import * as serviceWorker from './serviceWorker'

const btn1 = (
  <div>
    <h1>Hello, world!</h1>
    <button onClick={(e) => showTime(123, e)}>Delete Row</button>
    /*<button onClick={showTime}>testbtn</button>*/
  </div>
)
function showTime (parm1) {
  console.log(parm1)
  // ReactDOM.render(btn1, document.getElementById('root'))
  setInterval(tick, 100)
}
function tick () {
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  )
  ReactDOM.render(element, document.getElementById('root'))
}
